import React, { Component } from 'react'
import { List, Grid, Icon } from 'antd-mobile'
/**
 * Header Selector Component
 */
export default class HeaderSelector extends Component {

    constructor(props) {
        super(props);
        this.headerList = [];
        for (let i = 0; i < 20; i++) {
            this.headerList.push({
                text: 'Avatar ' + (i + 1),
                // icon: require(`./img/avatar${i + 1}.png`) // not use import
                icon: require('./img/avatar1.png') // not use import
            })
        }
    }

    render() {
        const listHeader = 'Please select your avatar'
        return (
            <List renderHeader={() => listHeader}>
                <Grid data={this.headerList} columnNum={5} />
            </List>
        )
    }
}
